import React from 'react';
import $ from "jquery";
import Axios from "../../utils/Axios";

const submitForm = (e) => {
    e.preventDefault()
    if ($('#email')[0].value === "" || $('#password')[0].value === "") {
        console.log('Invalid')
        return
    }
    Axios.post('http://127.0.0.1:4567/login', {
        email: $("#email")[0].value,
        password: $("#password")[0].value
    }).then((res) => {
        console.log(res)
    })
}

const Button = (props) => {
    return (
        <button type="submit" className="btn btn-primary" onClick={e => submitForm(e)}>{props.name}</button>
    );
};

export default Button;
